import React from 'react';
import './Footer.css';

const TeamItem = ({ active, children, to }) => (
    <div className="team-item">
        {children}
    </div>
)
const InfoItem = ({ active, children, to }) => (
    <div className="info-item">
        {children}
    </div>
)

const Footer = () => {
    return (
        <div className="footer">
            <div className="team">
                <TeamItem className="name">Team OHMIZA</TeamItem>
                <TeamItem>김진우</TeamItem>
                <TeamItem>김재훈</TeamItem>
                <TeamItem>박예린</TeamItem>
                <TeamItem>박영진</TeamItem>
            </div>
            <div className="info">
                <InfoItem>의견제안</InfoItem>
                <InfoItem>이용약관</InfoItem>
                <InfoItem>개인정보처리방침</InfoItem>
                <InfoItem>법적 책임과 한계</InfoItem>
                <InfoItem>© StudenTable</InfoItem>
            </div>
        </div>
    );
};

export default Footer;
